import React, { Component } from 'react';
import './login.css'

const Flag = false;
class App extends Component {

        constructor(props){
            super(props)
        }
    state={
        tempUserName : "",
        tempUserPassword : null,
        UserName : null,
        UserPassword: null,
    }

    temp = (event) =>{
            console.log("evetn",event.target.value) 

            let {
                name
            }   = event.target  
            name === "password" ? name = "tempUserPassword" : name = "tempUserName"
        this.setState({
            name : event.target.value
        },()=>{console.log("Name",this.state.tempUserName)})
    }




  render() {
    return (
         <div className="login-page">
        <div className="form registered ">

            <form className=" login-form">
                <input type="text" value={this.state.tempUserName} onChange={this.temp}  placeholder="user name"  />
                <input type="text" name="password" id="name" placeholder="password"/>
                <input type="button" value="LOGIN" className="btn"/>
                <p className="msg">Not Registered? <a href="#">Register</a></p>
            </form> 
        </div>
        </div>

    );
  }
}

export default App;
